  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:45.235399\",\n\t\"name\": \"investigating-bald-eagle-winter-and-summer-concentrations-on-cat-point-creek\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The objectives of this project are: 1)
  document the seasonal distribution and abundance patterns of Bald Eagles along Cat
  Point Creek  within 750 feet of the Route 624 Bridge and the navigable extent of
  the Cat Point Creek (the mouth of the creek to Menokin Bay) before, during, and
  after construction of a proposed new bridge over Route 624; 2) determine the level
  of human recreational and commercial use on Cat Point Creek from the mouth of the
  creek to Menokin Bay and within 750 feet of the Route 624 Bridge before, during
  and after construction; 3) evaluate changes, if any, in the distribution and abundance
  of Bald Eagles, people and boats along CPC and near the Route 624 Bridge as result
  of increased bridge height.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
